import {useState}from "react"
export default function Searc(){
    const[searchText, setSearchText] = useState();
    return(
        <div>
            <div>
                <h2>Buscador de personas</h2>
                <label>
                    <input 
                     value={searchText} 
                    onChange={({target: {value}})=>setSearchText(value)} 
                    />
                </label>
            </div>
        </div>
    );
}
